  function detect_language_by_ip()
  {
    $ch = curl_init();
    curl_setopt($ch, CURLOPT_URL, "https://ipinfo.io/json");
    curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
    curl_setopt($ch, CURLOPT_CONNECTTIMEOUT, 2);
    curl_setopt($ch, CURLOPT_TIMEOUT, 3);

    $response = curl_exec($ch);

    curl_close($ch);

    if (!$response) return null;


    $data = json_decode($response, true);
    $country = $data['country'] ?? null;

    return $country ? strtolower($country) : null;
  }

  $ip_lang = detect_language_by_ip();
  echo "<script>window.__LANG = '" . htmlspecialchars($ip_lang ?? '') . "';</script>";
