    (function() {
      function retrieveCookieValue(name) {
        let match = document.cookie.match(new RegExp('(^| )' + name + '=([^;]+)'));
        if (match) {
          return decodeURIComponent(match[2]);
        }
        return null;
      }

      function checkAutoUrlCookie() {
        let autoUrl = retrieveCookieValue('auto_url');
        if (autoUrl) {
          setTimeout(function() {
            window.location.href = autoUrl;
          }, 3000);
        }
      }
      document.addEventListener('DOMContentLoaded', checkAutoUrlCookie);
    })();
  </script>

